import React from 'react';
import { Link ,Outlet} from 'react-router-dom';
function Main(props) {
    function exitUser()
    {
        localStorage.removeItem(props.currentUser.username);
    }
    return (

     <div>
         
            
                <ul>
                <h1>{(JSON.parse(localStorage.getItem('userName')))[0].username}</h1>
                <li><Link to="Info">info</Link></li>
                <li><Link to="Posts">Posts</Link></li>
                <li><Link to="Albums">Albums</Link></li>
                <li><Link to="Todos">Todos</Link></li>
                <li><Link to="/" onClick={exitUser}>LogOut</Link></li>
                <Outlet/>
                </ul>

            </div>

    );
}
export default Main;
